import React, {useState, useEffect} from 'react';
import PageDefault from '../../components/pageDefault';
import styled from 'styled-components';

const Container = styled.div`
    max-width: 1360px;
    padding-right: 15px;
    padding-left: 15px;
    marging-right: auto;
    marging-left: auto;
    box-sizing: border-box;
    &:before,
    &:after{
        content: " ";
    display: table;
    }
    &:after{
        clear: both;
    }

`

export const Row = styled.div`
    width 100%;
    height: auto;
    float: left;
    box-sizing: border-box;
    &:before,
    &:after{
        content: " ";
    display: table;
    }
    &:after{
        clear: both;
    }

`;

const Column = styled.div`{
    float: left;
    padding: 0.25 rem;
    min-height: 1px;
    box-sizing: border-box;
    width: 100%;

    @media only screen and (min-width: 768px){
        width: ${props => (props.grid ? props.grid / 12 * 100: '8.33')}%;    
    }
}`;

function Home(){

    return(
        <PageDefault>
            <Container>
                <Row>
                   <Column grid='5'>grid 5</Column> 
                   <Column grid='2'>grid 2</Column> 
                   <Column grid='2'>grid 2</Column> 
                </Row>
            </Container>                   
        </PageDefault>
    );
}

export default Home;
